import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Form, Row, Col } from 'antd';

const Home = () => {
  return (
    <div style={{ padding: '24px' }}>
      <Row justify="center" align="middle" style={{ minHeight: '100vh', border: '1px solid black'}}>
        <Col xs={24} sm={12} md={8} lg={6}>
          <Form layout="vertical" style={{ border: '1px solid black', padding: '2rem', maxWidth: '80%'}}>
            <Form.Item>
              <Link to="/RegistrarAjustador">
                <Button type="primary" block>
                  Ir a Login
                </Button>
              </Link>
            </Form.Item>
          </Form>
        </Col>
      </Row>
    </div>
  );
};

export default Home;
